package syntaxtree;import visitor.InterpreterVisitor;import visitor.Visitor;import visitor.TypeVisitor;public class Identifier {  public String s;  public Position position = null;    public Identifier(String as, Position p) {     s=as;    position = p;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }  public Object accept(InterpreterVisitor v) {	  return v.visit(this);  }    public String toString(){    return s;  }}